import React from 'react';
import styled from "styled-components";

const ContentBlock = styled.div`
    background-color: #F8F9FA;
`;



const Content = () => {
    return (
        <>
        <ContentBlock>
        <BoxEach>
            <Picture></Picture>


        </BoxEach>
        </ContentBlock>
        
        
        </>
    );
};

export default Content;
